#!/usr/bin/env python

import sys
import json
from datetime import datetime


class Package:
    def __init__(self, name, version, ecosystem, vulnerabilities, groups):
        self.name = name
        self.version = version
        self.ecosystem = ecosystem
        self.vulnerabilities = vulnerabilities
        self.groups = groups


class Groups:
    def __init__(self, max_severity):
        self.score = max_severity


class Vulnerability:
    def __init__(self, id, aliases, summary, details, affected, references, database_specific):
        self.id = id
        self.aliases = aliases
        self.summary = summary
        self.details = details
        self.affected = affected

        self.severity_res = database_specific['severity']
        self.references = [ref['url'] for ref in references if ref['type'] == 'ADVISORY']
        self.ref_package = [ref_p['url'] for ref_p in references if ref_p['type'] == 'PACKAGE']
        self.fixed_in = None
        
        for affected_version in affected[0]['ranges'][0]['events']:
            if 'fixed' in affected_version:
                self.fixed_in = affected_version['fixed']
                break


json_data_file = sys.argv[1]  

try:
    with open(json_data_file, "r") as f:
        data = json.load(f)
except FileNotFoundError:
    print("Error: JSON file not found!", file=sys.stderr)
    sys.exit(1)
except json.JSONDecodeError as e:
    print("Error: Invalid JSON format!", file=sys.stderr)
    print(f"Details: {e}", file=sys.stderr)
    sys.exit(1)

    
organized_packages = []

vun_nb = 0
vun_pk = 0

for result in data['results']:
    for package_data in result['packages']:
        vun_pk = vun_pk + 1
        package_info = package_data['package']
        package_name = package_info['name']
        package_version = package_info['version']
        package_ecosystem = package_info['ecosystem']
        
        vulnerabilities = []
        for vulnerability_data in package_data['vulnerabilities']:
            vun_nb = vun_nb + 1
            vulnerability = Vulnerability(
                id=vulnerability_data['id'],
                aliases=vulnerability_data['aliases'],
                summary=vulnerability_data['summary'],
                details=vulnerability_data['details'],
                affected=vulnerability_data['affected'],
                references=vulnerability_data['references'],
                database_specific=vulnerability_data['database_specific']
            )
            vulnerabilities.append(vulnerability)
        
        groups = []
        for groups_data in package_data['groups']:
            grou = Groups(
                max_severity=groups_data['max_severity']
            )
            groups.append(grou)
        
        package = Package(
            name=package_name,
            version=package_version,
            ecosystem=package_ecosystem,
            vulnerabilities=vulnerabilities,
            groups=groups
        )
        organized_packages.append(package)

html_output = """
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Vulnerability Report</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Montserrat:ital,wght@0,100..900;1,100..900&family=Rubik:ital,wght@0,500;1,500&display=swap');

        body {
            font-family: 'Montserrat', sans-serif;
            margin: 0;
            padding: 0;
            background-color: #f2f2f2;
        }

        .container {
            max-width: 1200px;
            margin: 0 auto;
            padding: 20px;
            background-color: #fff;
        }

        h1, h2, h3 {
            font-family: 'Rubik', sans-serif;
            color: #333;
        }

        .info {
            padding-top: 20px;
            padding-bottom: 20px;
        }
        .header {
            text-align: center;
            margin-top: 40px;
            margin-left: 10px;
            margin-right: 35px;
        }
        .left-logo, .right-logo {
            display: inline-block;
            width: auto;
            height: 100px; /* Adjust the height as needed */
            margin-top: 10px;
            margin-bottom: 60px;
        }

        .left-logo img, .right-logo img {
            max-width: 80%;
            height: auto;
        }
        .left-logo {
            float: left;
        }
        .right-logo {
            float: right;
        }
        .clear {
            clear: both;
        }
        .package-table {
            width: 100%;
            border-collapse: collapse;
        }

        .package-table th, .package-table td {
            padding: 8px;
            text-align: left;
            border-bottom: 1px solid #ddd;
        }

        .package-table th {
            background-color: #f2f2f2;
            color: #333;
        }

        .package-table tr:hover {
            background-color: #f5f5f5;
        }

        .vulnerability {
            margin-top: 20px;
            padding: 20px;
            border: 1px solid #ddd;
            background-color: #fff;
        }

        .vulnerability h2 {
            margin-top: 0;
        }

        .vulnerability p {
            margin-bottom: 10px;
        }

        .references a {
            display: block;
            margin-bottom: 5px;
        }

        .score {
            font-weight: bold;
            color: #ff3333;
        }

        .severity {
            font-weight: bold;
            color: #ff3333;
        }
    </style>
</head>
<body>
<div class="header">
    <img src="" alt="Right Logo" class="right-logo">
    <img src="data:image/png;base64," alt="Left Logo" class="left-logo">
    <div class="clear"></div>
</div>
<div class="container">
    <h1>OSV Scan Dependency-Check Report</h1>
    """

now = datetime.now()
projct_name = sys.argv[2]
cv = float(sys.argv[4])
date_time = now.strftime("%a, %d %b %Y  %H:%M:%S")

html_output += f"<h2>Project: {projct_name}</h2>"
html_output += f"<div class='info'><p>OSV Scanner Version: v1.2 custom build (based on open-source version)</p>"
html_output += f"<p>Report Generated On: {date_time}</p>"
html_output += f"<p>Vulnerable Packages: {vun_pk}</p>"
html_output += f"<p>Vulnerabilities Found: {vun_nb}</p></div>"

html_output += "<h2>Summary</h2>"
html_output += "<table class='package-table'>"
html_output += "<thead><tr><th>Package</th><th>Version</th><th>Score</th><th>Severity</th><th>Vulnerability ID</th></tr></thead>"
html_output += "<tbody>"

for package in organized_packages:
    html_output += f"<tr><td><a href='#details_{package.name}'>{package.name}</a></td>"
    html_output += f"<td>{package.version}</td>"
    html_output += f"<td class='score'>{package.groups[0].score}</td>"
    if float(package.groups[0].score) > cv:
        error_msg = f"Scan Failed -> CVSS RULE: {', '.join(package.vulnerabilities[0].aliases)}: {package.groups[0].score} is greater than your rule CVSS={cv}"
        print(error_msg, file=sys.stderr)
        sys.exit(1)
    html_output += f"<td class='severity'>{package.vulnerabilities[0].severity_res}</td>"
    html_output += f"<td>{', '.join(package.vulnerabilities[0].aliases)}</td></tr>"
html_output += "</tbody></table>"


    
current_pack = ""


file_name = "/osv-scanner/reports/" + sys.argv[3]

for index, package in enumerate(organized_packages):
    html_output += f"<div class='vulnerability' id='details_{package.name}'>"
    for vulnerability in package.vulnerabilities:
        new_pack = package.name
        for ref_p in vulnerability.ref_package:
                if current_pack == new_pack:
                    break
                current_pack = new_pack
                html_output += f"<h2>Package <a href='{ref_p}' target='_blank'>{package.name}@{package.version}</a></h2></h2>"
    html_output += f"<p><strong>Name:</strong> {package.name}</p>"
    html_output += f"<p><strong>Version:</strong> {package.version}</p>"
    html_output += f"<p><strong>Ecosystem:</strong> {package.ecosystem}</p>"
    html_output += "<h3>Vulnerabilities:</h3>"
    html_output += "<p>-----------------------------------------</p>"

    for vulnerability in package.vulnerabilities:
        html_output += "<div class='vulnerability-details'>"
        html_output += f"<p><strong>ID:</strong> {vulnerability.id}</p>"
        html_output += f"<p><strong>Summary:</strong> {vulnerability.summary}</p>"
        html_output += f"<p><strong>Details:</strong> {vulnerability.details}</p>"
        html_output += f"<p><strong>Severity:</strong> {vulnerability.severity_res}</p>"
        html_output += f"<p><strong>Aliases:</strong> {', '.join(vulnerability.aliases)}</p>"
        html_output += f"<p><strong>Fixed In Version:</strong> {vulnerability.fixed_in}</p>"
        html_output += "<p><strong>References:</strong></p>"
        html_output += "<div class='references'>"
        for ref in vulnerability.references:
            html_output += f"<a href='{ref}' target='_blank'>{ref}</a>"
        html_output += "</div>"
        html_output += f"<a href='https://osv.dev/vulnerability/{', '.join(vulnerability.aliases)}' target='_blank'>https://osv.dev/vulnerability/{', '.join(vulnerability.aliases)}</a>"
        html_output += f"<p><strong>Score:</strong> {package.groups[0].score}</p>" 
        html_output += "<p>-----------------------------------------</p>"
        html_output += "</div>"
    html_output += "</div>"

html_output += "</div></body></html>"

with open(file_name, "w") as html_file:
    html_file.write(html_output)

